                $image =  UploadedFile::getInstance($obj,'image['.preg_replace('/-\d+/i', '', $obj->type).']');
            }
            else {
                $image =  UploadedFile::getInstance($obj,'image['.$obj->type.']');
            }

            if($image)
            {
                $obj->image = $id . '-'.$obj->type.'-'. Yii::$app->security->generateRandomString() . '.' . $image->extension;
