                        if($iTime != '')
                        {
                            $datetime = explode(" ", $iTime);
                            $iTime  = str_replace(":","-",$datetime[0])." ".$datetime[1];
                        }
                        $bLat = Yii::$app->session->get('user.lat');
                        $bLong = Yii::$app->session->get('user.long');
