            if(count($pendingFor) > 0){
              // Sample array
              $myArray = $pendingFor;

              // Search for the string to remove
              $searchString = $OtherFile->type;

              // Create a new array to store the elements we want to keep
              $newArray = array();

              // Loop through the original array and only add elements that do not match the search string
              foreach ($myArray as $element) {
