    protected function updateQc($preModel,$updateType)
    {
        if($preModel->vehicleType == 'ALL-VEHICLE')
        {
            if($updateType == 'insert')
            {
                $countPosts = AxionPreinspectionVehicle::find()
                ->where(['preinspection_id' => $preModel->id])
