            'amount'          => $amount, // Amount in paise (50000 paise = 500 INR)
            'currency'        => 'INR',
            'payment_capture' => 1 // Auto capture the payment
        ];
        $razorpayOrder = $api->order->create($orderData);
        $premodel->oreder_id = $razorpayOrder['id'];
        $premodel->save();
        $payModel->pre_id = $id;
        $payModel->amount = $amount;
        $payModel->order_id = $razorpayOrder['id'];
        $payModel->save();
        // Pass the Razorpay order ID to the view
        return $this->render('payment', [
            'apiKey' => $apiKey,
            'amount' => $amount, // Amount in paise
            'currency' => 'INR',
            'razorpayOrderId' => $razorpayOrder['id'],
            'premodel' => $premodel
        ]);
    }

    protected function getReferenceNo()
    {
        if (($model = AxionPreinspection::find()->orderBy(['id' => SORT_DESC])->one()) !== null) {
            return ($model->referenceNo) + 1;
