    private function getStatusLabel($status) {
        switch ($status) {
            case 101:
                return 'PI-Recommended';
            case 102:
                return 'PI-Not Recommended';
            case 103:
                return 'PI-Inprogress';
            case 104:
                return 'PI-Refer to Under Writer';
            case '9':
                return 'Cancelled';
            default:
                return '';
        }
    }
