    protected static function generateGemeniAIExtractPdf($base64img)
    {
        try {
            // Your API key
            //$apiKey = 'AIzaSyBFGerjXCvRZFRWNDhQ2xd9TNHor1ap0qA'; // VJ Google AI Studio API Key Test
            $apiKey = 'AIzaSyA_FNbnR7HOjCBoiRJUGKYxcrZd7gJVRkU'; // VJ Google AI Studio API Key Test

            // API endpoint
            $apiUrl = 'https://generativelanguage.googleapis.com/v1beta/models/gemini-1.5-pro-latest:generateContent?key=' . $apiKey;

            // Base64 encode the image
            $imageBase64 = $base64img;

            // Request payload
            $payload = [
                'contents' => [
                    'parts' => [
                        [
                            'inlineData' => [
                                'mimeType' => 'image/jpeg',
                                'data' => $imageBase64
                            ]
                        ],
                        [
                            'text' => "\n\n You are an AI data extractor. From the attached vehicle RC file, extract the data in the below JSON format. Extract all the key value information in 'details' and tabular information in 'tables'.
                            \n
                            {
                                \"details\":{\"name\":\"\"},
                                \"tables\":{\"data\":[[\"\",\"\"]]}
                            }"
                        ]
                    ]
                ],
                'generationConfig' => [
                    'temperature' => 0.75,
                    'topK' => 50,
                    'topP' => 0.75,
                    'maxOutputTokens' => 100000,
                    'response_mime_type' => 'application/json',
                    'stopSequences' => []
                ],
                'safetySettings' => [
                    [
                        'category' => 'HARM_CATEGORY_HARASSMENT',
                        'threshold' => 'BLOCK_MEDIUM_AND_ABOVE'
                    ],
                    [
                        'category' => 'HARM_CATEGORY_HATE_SPEECH',
                        'threshold' => 'BLOCK_MEDIUM_AND_ABOVE'
                    ],
                    [
                        'category' => 'HARM_CATEGORY_SEXUALLY_EXPLICIT',
                        'threshold' => 'BLOCK_MEDIUM_AND_ABOVE'
                    ],
                    [
                        'category' => 'HARM_CATEGORY_DANGEROUS_CONTENT',
                        'threshold' => 'BLOCK_MEDIUM_AND_ABOVE'
                    ]
                ]
            ];

            // Make the request to the API with cURL
            $ch = curl_init($apiUrl);
            curl_setopt($ch, CURLOPT_POST, 1);
            curl_setopt($ch, CURLOPT_POSTFIELDS, json_encode($payload));
            curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
            curl_setopt($ch, CURLOPT_HTTPHEADER, [
                'Content-Type: application/json',
            ]);

            $response = curl_exec($ch);
            $httpCode = curl_getinfo($ch, CURLINFO_HTTP_CODE);

            // Check for cURL errors
            if (curl_errno($ch)) {
                return "cURL Error: " . curl_error($ch);
            }

            curl_close($ch);

            // Handle the API response
            if ($httpCode == 200) {
                // Successful response
                $responseData = json_decode($response, true);
                // Handle the response data as needed
                return $responseData;
            } else {
                // Error in the API request
                return "API Error: $httpCode\nResponse: $response\n";
            }
        } catch (\Exception $e) {
            // Handle the exception
            return "Exception: " . $e->getMessage();
        }
    }
