            $pdfFilename = Yii::getAlias('@runtime/tmp/') . $premodel->referenceNo . '.pdf';

            // Render the PDF and save to the file system
            $pdf->render();

            // Send email with PDF attachment
            $email = Yii::$app->mailer->compose()
                ->setFrom('virtual.survey@axionpcs.in')
                ->setTo($UserEmail)
                //->setCc([$emailBranch, $emailDivision])
                ->setSubject('PI-AUTO QC')
                ->setTextBody('Please find the attached PI-Auto QC in PDF format.')
                ->attach($pdfFilename, ['fileName' => $premodel->referenceNo . '.pdf', 'contentType' => 'application/pdf']);

            // Check if the email is sent successfully
            if (!$email->send()) {
                Yii::$app->session->setFlash('error', 'Failed to send the email.');
            } else {
                Yii::$app->session->setFlash('success', 'The PDF report has been sent to ' . $UserEmail . '.');
            }

            // Clean up temporary files
            unlink($pdfFilename);

            // return $this->redirect(['transation-completed']);
            return $this->redirect(['transation-completed', 'id' => $id]);
        }
